import javax.mail.*;
import javax.mail.internet.*;
import java.util.*;
import javax.activation.*;
import javax.xml.bind.DatatypeConverter;

public class SendMailSSL {
	public static void main(String[] args) throws Throwable{
		final String username = "<%=odiRef.getOption("USERNAME")%>";
		final String password64 = "<%=odiRef.getOption("PASSWORD")%>";
 		final String path="<%=odiRef.getOption("ATTACHMENT_PATH")%>";
		final String filename="<%=odiRef.getOption("ATTACHMENT_FILE_NAME")%>";
		final String sourcefile= path + "\\" + filename;
		Properties props = new Properties();
		props.put("mail.smtp.host", "<%=odiRef.getOption("HOSTNAME")%>");
		props.put("mail.smtp.socketFactory.port", "465");
		props.put("mail.smtp.socketFactory.class","javax.net.ssl.SSLSocketFactory");
		props.put("mail.smtp.auth", "<%=odiRef.getOption("AUTHENTICATION")%>");
		props.put("mail.smtp.port", "465");

		// jdk > 1.8
		byte[] decodedBytes = Base64.getDecoder().decode(password64);
		final String password = new String(decodedBytes);

		// jdk < 1.8
		//byte[] decodedBytes = DatatypeConverter.parseBase64Binary(password64);
		//final String password = new String(decodedBytes, "UTF-8");

		//Authentication
		Session session = Session.getDefaultInstance(props,
			new javax.mail.Authenticator() {
				protected PasswordAuthentication getPasswordAuthentication() {
					return new PasswordAuthentication(username,password);
				}
			});

		try {

			Message message = new MimeMessage(session);
			message.setFrom(new InternetAddress("<%=odiRef.getOption("FROM")%>"));
			message.setRecipients(Message.RecipientType.TO,
			InternetAddress.parse("<%=odiRef.getOption("TO")%>"));
			message.setSubject("<%=odiRef.getOption("SUBJECT")%>");
			//message.setText("<%=odiRef.getOption("BODY")%>");

			//add at least simple body
			MimeBodyPart body = new MimeBodyPart();
			body.setText("<%=odiRef.getOption("BODY")%>");
			Multipart multipart = new MimeMultipart();
			multipart.addBodyPart(body);

			//do attachment
			if (filename.length()>0){
			MimeBodyPart attachMent = new MimeBodyPart();
			DataSource dataSource = new FileDataSource(sourcefile);
			attachMent.setDataHandler(new DataHandler(dataSource));
			attachMent.setFileName(filename);
			attachMent.setDisposition(MimeBodyPart.ATTACHMENT);
			multipart.addBodyPart(attachMent);
			}

			message.setContent(multipart);

			Transport.send(message);

			System.out.println("Done");

		} catch (MessagingException e) {
			throw new RuntimeException(e);
		}
	}
}
